1) On 1913-12-17, it was thought that this Chinese had gained admission to this country as the son of a man not his father;
2) On 1914-1-5 there was a warrant of arrest  against Lee Lum;
3) On 1915-1-18, this warrant was cancelled.

1. First admitted on 1914-1-13 as a merchant at San Francisco, with 2 sons;
2. Applied for merchant return certificate on 1922-1-31 at Boston, Mass., with 3 sons;
3. He left the US in 1922 through Boston and came back through Seattle on 1923-11-26, with 4 sons;He made a second trip to China as a labor through Seattle in 1927 and returned as a labor through Seattle on 1928-5-7.

1. The applicant's home had moved from Wong Toy Village, SND to Sun Woy Fong Village, SWD in 1927.
2. His five sons: Chin King, born in Jan. 29, 1899;
Chin Yin, born in Oct. 10, 1899;
Chin Dew, born in Jan. 4, 1911;
China You, born in Sept. 17, 1922, above are born in Wong Toy village;
Chin Yick, born in Dec. 4, 1927, Sun Woy Fong village.

1.  Applicant made two trips to China prior to this application: 1) 1884 – 1900, returned by way of Malone, New York; 2) 1924 – Sep 20, 1926, left and returned through Seattle, s. s. Pres. Jefferson, and admitted as a native. (Issued Sep 23, 1926);

2.  Applicant was unemployed at the time of this application.

3.  Not enough information to determine the exact time period when applicant worked at the mentioned restaurant (Far East Restaurant). However, he was working there during his second application in 1924, and in one of the letter correspondents, his addressed was given as the addressed of the restaurant on Sep 27, 1926, so it’s very likely that he worked there as a waiter at least during 1924 - 1927.
